for (df_name in df_names) {
  # Get the actual data frame
  df <- get(df_name)
  # Check if columns ID and Visit exist
  if (all(c("wrapnum", "VisNo") %in% colnames(df))) {
    # Find duplicates using dplyr
    dup_rows <- df %>% 
      dplyr::group_by(wrapnum, VisNo) %>% 
      dplyr::filter(n() > 1) %>% 
      dplyr::ungroup()
    # If any duplicates found, assign to new data frame with _Duplicates
    if (nrow(dup_rows) > 0) {
      new_name <- paste0("Duplicates_",df_name)
      assign(new_name, dup_rows)
      cat("Duplicates found and saved to:", new_name, "\n")
    } else {
      cat("No duplicates found in:", df_name, "\n")
    }
  } else {
    cat("Skipping", df_name, "- ID and/or Visit column not found\n")
  }
}
